import React from 'react';
import {Modal} from 'reactstrap';

class Login extends React.Component {

    constructor(props){
        super(props);
    }

    componentDidMount() {
        this.setState({display: 'block'})
    }

    hideModal = () => {
        this.state.display = 'none';
    };

    render() {
        return (
            <div id="login" className={Modal} style={{display: this.state.display}}>
                <div className="modal-dialog modal-lg" role="document">
                    <div className="modal-content">
                        <div className="modal-header">
                            <h5 className="modal-title">Регистрация нового пассажира</h5>
                            <button type="button" className="close" onClick={this.hideModal}>
                                <span aria-hidden="true">&times;</span>
                            </button>
                        </div>
                        <div className="modal-body" />
                        <div className="modal-footer">
                            <button type="button" className="btn btn-primary" onClick={this.hideModal}>ОК</button>
                        </div>
                    </div>
                </div>
            </div>
        );
    }
}

export default Login;
